import React, { useState, useEffect } from 'react'

function Amenities() {

  const [data, setData] = useState([{}])
  useEffect(() => {
    fetch("/api/v1/amenities"
    ).then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  return (
    <div>
      {data.map((x, i) => (
        <p key={i}>{x.name}
          <br />
          {x.id}</p>
      ))
      }
    </div >
  )
}

async function AmenititesNew() {
  async function createAmenity(formData) {
    console.log(formData)
    const [res, setRes] = useState({})
    useEffect(() => {
      fetch("/api/v1/amenities", { method: "POST", body: formData })
    })
  };

  return (
    <form action={createAmenity}>
      <label>Amenity name</label>
      <input name="name" />
      <label>Amenity description</label>
      <input name="description" />
      <button type="submit">Create Amenity</button>
    </form>
  )
}

exports = {
  Amenities,
  AmenititesNew
}
